import React, { useEffect, useState } from "react";
import axiosInstance from "../../baseurl";
import {Link, useNavigate} from 'react-router-dom'
import ViewDocChat from "./ViewDocChat";

function Docchat() {
  const [allcustomersfordoc, setallcustomersfordoc] = useState([]);
  const [allcustomers, setallcustomers] = useState([]);
  const [setid,setsetid] = useState('')
  const Navigate = useNavigate()
  useEffect(()=>{
    if(localStorage.getItem(`Doctorlogid`)==null){
      Navigate(`/home`)
    }
  })
  useEffect(() => {
    axiosInstance
      .post(`/ViewPatientstoChat/${localStorage.getItem("Doctorlogid")}`)
      .then((res) => {
        console.log(res, "View Customers for doc");
        if (res.data.data != undefined) {
          setallcustomersfordoc(res.data.data);
        }
      })
      .catch((err) => {
        console.log(err);
      });
    axiosInstance
      .post(`viewCustomers`)
      .then((res) => {
        console.log(res, "View all cust");
        if (res.data.data != undefined) {
          setallcustomers(res.data.data);
        }
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div className="container-top">
      Docchat
      <div className="container">
        <div className="row">
          <div className="col-3">
            <h1> Customers</h1>
            <hr />
            {allcustomersfordoc.length
              ? allcustomersfordoc.map((a) => {
                let x 
                for (let i of allcustomers){
                  if(i._id==a){
                    x = i.name
                  }
                }
                  return <div key={a}> <button onClick={()=>{setsetid(a)}} className="btn btn-primary" style={{margin:"10px"}}>{x} </button></div>;
                })
              : null}
          </div>
          <div className="col-9">
          <ViewDocChat chatid={setid}/>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Docchat;
